import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class AnagramCheck {

    public List<Integer> findAnagrams(String s, String p) {
        if (p.length() > s.length()) return new ArrayList<>();
        int sLength = p.length();
        char[] smallSorted = p.toCharArray();
        Arrays.sort(smallSorted);
        //int hashCode = new String(smallSorted).hashCode();
        String smallSortedStr = new String(smallSorted);
        List<Integer> anagrams = new ArrayList<>();
        int size = s.length();
        char[] fullCharArr = s.toCharArray();
        for (int i = 0; i < size; i++) {
            if (i + sLength > size) break;
            String subStr = new String(fullCharArr, i, sLength);
            char[] sortedSubStr = subStr.toCharArray();
            Arrays.sort(sortedSubStr);
            if (String.valueOf(sortedSubStr).equals(smallSortedStr)) anagrams.add(i);
        }
        return anagrams;
    }


    public static void main(String[] args) {
        AnagramCheck a = new AnagramCheck();
        System.out.println(a.findAnagrams("",
                ""));
    }
}
